import logo from './icons/logo.svg';
import planeIcon from './icons/plane.svg';
import linkIcon from './icons/link.svg';
import CVLink from './docs/CV.pdf';
import './App.css';

function Button({ icon, text, link }) {
  return (
    <a href={link} target="_blank" rel="noopener noreferrer" className="button-link">
      <button className="button">
        {icon && <img src={icon} alt="button icon" className="button-icon" />}
        {text}
      </button>
    </a>
  );
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <br />
        <div className="button-panel">
          <Button icon={linkIcon} text="LinkedIn" link="https://www.linkedin.com/in/hannahgillespie/" />
          <Button icon={planeIcon} text="CV / Resume" link={CVLink} />
          <Button icon={linkIcon} text="Portfolio" link="https://your-portfolio-link.com" />
          <Button icon={planeIcon} text="Contact" link="mailto:your-email@example.com" />
        </div>
      </header>
    </div>
  );
}

export default App;
